import React from 'react';
import { useSelector } from 'react-redux';
import reducers from '../redux/reducer/index';
import { IArtist } from '../interfaces';

const ResultPage = () => {
	const search_result = useSelector((state: any) => state.search);
	const { data, next, total }: any = search_result;

	const PerResult = (track: any) => {
		return (
			<div key={track.id} className='col-lg-3 p-3'>
				<div className='bg-light p-3'>
					<img src={track.album.cover} className='img-fluid' alt='album name' />

					<h4 className='h3 text-center'>{track.title}</h4>
					<h6 className='text-center h6'>{track.artist.name}</h6>
				</div>
			</div>
		);
	};

	const array: any[] = [];

	for (let i = 0; i < data.length; i++) {
		array.push(data[i]);
	}

	let elements = array.map((item: any) => (
		<PerResult key={item.id} track={item} />
	));

	console.log(elements);
	return (
		<div className='container'>
			<div className='row'>{elements && elements.map((track) => track)}</div>
		</div>
	);
};

export default ResultPage;
